import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Header from "./Components/Header/Header";
import Landing from "./Components/Landing/Landing";

function App() {
  return (
  <BrowserRouter>
    <Header />;
    <Switch>
      <Route path="/" exact component={Landing} />
    </Switch>
  </BrowserRouter>
      );
}

export default App;
